var tipuesearch = {"pages": [{'title': 'About', 'text': '40923114. \n 個人倉儲: \xa0 https://github.com/40923114/cd2022 \n 個人網站: \xa0 https://40923114.github.io/cd2022/content/index.html', 'tags': '', 'url': 'About.html'}, {'title': 'midterm', 'text': 'ag3分配: \n NX: \xa0 40923111 、 40923122 、 40923146 Onshape: \xa0 40923115 、 40923114 、 40923129 Solvespace: \xa0 40923148 、 40923209 \n \n 流程: 1.至 w8任務 頁面下載零件檔。 2.使用已分配的繪圖程式將零件繪出。 3.將零件檔轉為dwg檔，使用AutoCAD確認尺寸 4.繪製零件 5.將零件檔結合輸出成組合圖.STL。 6.將已繪製好的組合圖匯入 CoppeliaSim。 7.嘗試使用 CoppeliaSim設定並操作前三軸. \n 心得: \n 這次我被分配到的是onshape，上學期有稍微用過，大概知道怎麼做，但使用上還是有些不順手，速度很慢尺寸也有些不一樣，不會的地方也會跟同學討論，日後會更加精進自己的繪畫能力。 \n', 'tags': '', 'url': 'midterm.html'}, {'title': 'nx', 'text': '\n \n \n   \n', 'tags': '', 'url': 'nx.html'}, {'title': '進度', 'text': 'W6 \n blog \n W7 \n 設法以隨身程式系統編譯此程式碼 \n W8 \n 組員一起繪出零件圖 一起組立作動 \n W9 \n 期中考 \n w10 \n w10_block_ui \n w11 \n 加入個人 w8-w10 協同設計過程所負責的項目內容與心得 \n w12 \n 回答w8的問題 \n w13 \n 看歷屆畢業學長姐的考研資料 \n w14 \n 以程式碼驅動旋轉臂 \n w16 \n 測驗 回答問題 \n', 'tags': '', 'url': '進度.html'}, {'title': 'w11s4', 'text': '', 'tags': '', 'url': 'w11s4.html'}, {'title': '14號', 'text': '\n W8:分配繪圖軟體 \n NX: \xa0 40923111 、 40923122 、 40923146 Onshape: \xa0 40923115 、 40923114、 40923129 Solvespace: \xa0 40923148 、 40923209 \n 心得 : \n 我被分配到的是onshape，上學期有稍微用過，大概知道怎麼做，但使用上還是有些不順手，速度很慢尺寸也有些不一樣，不會的地方也會跟同學討論，日後會更加精進自己的繪畫能力。 \n W10:在老師的Wink上添加註解 \n 心得 :我覺得在影片上註解非常重要，因為每個人的理解是不一樣的，有了註解能讓人淺顯易懂。 \n', 'tags': '', 'url': '14號.html'}, {'title': 'w12', 'text': '總共引用155個子零件 \n 個別零件總數為58 \n 零件採鋁製 總重量1.4123kg \n 零件採鋼製 總重量4.1062kg \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w16', 'text': '本周為測驗 \n https://mde.tw/cd2022_guide/content/Online%20Exam.html \n 第一題 遠端控制手臂 \n (1)將老師給的uarm_nx_tkinter_gui_control.ttt 打開 且按下啟動鍵 \n (2)啟動後按下\xa0 to connect 就可以模擬了 \n 第二題 方塊模擬 \n \n', 'tags': '', 'url': 'w16.html'}]};